import IconButton from '@mui/material/IconButton';

function Positiv(props){



    return (
        <div className={classes.container}>

            <div className={classes.spalte}>

                <div className={classes.box}>
                    <div className={classes.boxHeading}>
                        1  Zusammenarbeit im Projekt/ Teamspirit und Konfliktkultur
                    </div>

                <TextField value={"data.autor"}  label="Autor" variant="standard" sx={{width:'100%'}}/>



                </div>

            </div>


        </div>
    );
}

export default Positiv;
